css:
.editor {
  background-color: rgba(9, 10, 27, 0.95);
  color: #f8f8f8;
}
.editor .gutter {
  background-color: rgba(9, 10, 27, 0.95);
  color: #f8f8f8;
}
.editor .gutter .line-number.cursor-line {
  background-color: rgba(0, 0, 0, 0);
  color: #f8f8f8;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: #f8f8f8;
}
.editor .wrap-guide {
  color: rgba(202, 226, 251, 0.24);
}
.editor .indent-guide {
  color: rgba(202, 226, 251, 0.24);
}
.editor .invisible-character {
  color: rgba(202, 226, 251, 0.24);
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: rgba(202, 226, 251, 0.24);
}
.editor .search-results .marker.current-result .region {
  border: #f8f8f8;
}
.editor.is-focused .cursor {
  border-color: #00ffff;
}
.editor.is-focused .selection .region {
  background-color: rgba(0, 125, 255, 0.5);
}
.editor.is-focused .line-number.cursor-line-no-selection,
.editor.is-focused .line.cursor-line {
  background-color: rgba(0, 0, 0, 0);
}
.comment {
  font-style: italic;
  color: #C050C2;
  background-color: #000000;
}
.constant {
  color: #0A9CFF;
}
.entity {
  color: #6FD3FF;
}
.keyword {
  color: #FF3854;
}
.storage {
  color: #99CF50;
}
.string {
  color: #8FFF58;
  background-color: rgba(16, 38, 34, 0.98);
}
.support {
  color: #00FFBC;
}
.variable {
  color: #588AFF;
}
.invalid.deprecated {
  font-style: italic;
  text-decoration: underline;
  color: #FD5FF1;
}
.invalid.illegal {
  color: #FD5FF1;
  background-color: rgba(86, 45, 86, 0.75);
}
.text .source {
  background-color: rgba(177, 179, 186, 0.03);
}
.entity.other.inherited-class {
  font-style: italic;
  color: #FF9749;
}
.string.quoted .source {
  color: #D972DE;
}
.string .constant {
  color: #D972DE;
}
.string.regexp {
  color: #E9C062;
}
.string.regexp .constant.character.escape,
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #CF7D34;
}
.string .variable {
  color: #8A9A95;
}
.support.function {
  color: #F1D950;
}
.support.constant {
  color: #CF6A4C;
}
.meta.preprocessor.c {
  color: #8996A8;
}
.meta.preprocessor.c .keyword {
  color: #AFC4DB;
}
.entity.name.type {
  text-decoration: underline;
}
.meta.cast {
  font-style: italic;
  color: #676767;
}
.meta.sgml.html .meta.doctype,
.meta.sgml.html .meta.doctype .entity,
.meta.sgml.html .meta.doctype .string,
.meta.xml-processing,
.meta.xml-processing .entity,
.meta.xml-processing .string {
  color: #494949;
}
.meta.tag,
.meta.tag .entity {
  color: #45C1EA;
}
.source .entity.name.tag,
.source .entity.other.attribute-name,
.meta.tag.inline,
.meta.tag.inline .entity {
  color: #45C1EA;
}
.entity.name.tag.namespace,
.entity.other.attribute-name.namespace {
  color: #E18964;
}
.meta.selector.css .entity.name.tag {
  color: #8B98AB;
}
.meta.selector.css .entity.other.attribute-name.tag.pseudo-class {
  color: #8B98AB;
}
.meta.selector.css .entity.other.attribute-name.id {
  color: #8B98AB;
}
.meta.selector.css .entity.other.attribute-name.class {
  color: #8B98AB;
}
.support.type.property-name.css {
  color: #C5AF75;
}
.meta.property-group .support.constant.property-value.css,
.meta.property-value .support.constant.property-value.css {
  color: #F9EE98;
}
.meta.preprocessor.at-rule .keyword.control.at-rule {
  color: #8693A5;
}
.meta.property-value .support.constant.named-color.css,
.meta.property-value .constant {
  color: #FF6A4B;
}
.meta.constructor.argument.css {
  color: #8F9D6A;
}
.meta.diff,
.meta.diff.header {
  font-style: italic;
  color: #F8F8F8;
  background-color: #00184F;
}
.markup.deleted {
  color: #F8F8F8;
  background-color: #74052A;
}
.markup.changed {
  color: #F8F8F8;
  background-color: #A96A06;
}
.markup.inserted {
  color: #F8F8F8;
  background-color: #008A41;
}
.markup.italic {
  font-style: italic;
  color: #E9C062;
}
.markup.bold {
  color: #E9C062;
}
.markup.underline {
  text-decoration: underline;
  color: #E18964;
}
.markup.quote {
  font-style: italic;
  color: #E1D4B9;
  background-color: rgba(254, 224, 156, 0.07);
}
.markup.heading,
.markup.heading .entity {
  color: #FEDCC5;
  background-color: #632D04;
}
.markup.list {
  color: #E1D4B9;
}
.markup.raw {
  color: #578BB3;
  background-color: rgba(177, 179, 186, 0.03);
}
.markup .comment {
  font-style: italic;
  color: #F67B37;
}
.meta.separator {
  color: #60A633;
  background-color: #242424;
}
.meta.line.entry.logfile,
.meta.line.exit.logfile {
  background-color: rgba(238, 238, 238, 0.16);
}
.meta.line.error.logfile {
  background-color: #751012;
}
